import React from 'react';
import { Grid } from '@material-ui/core';
import Map from '../components/Map'
import FormContact from "../components/FormContact";

export default function Propiedad(){
        const { prop } = this.state
        const { match } = this.props
        const zoomP = 13
        const heightP = 300
        const prefijo = "PROPIEDAD"
        const text = "Consultar por la Propiedad"

        return (
            <div>
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                    </Grid>  
                    <Grid item xs={6}>
                        {prop.map(item => {
                            if (match.params.id == item.id) {
                                return (
                                    <div key={item.id}>
                                        <h1>
                                            {item.tittle}
                                        </h1>
                                        <Map
                                            position={item.coordenadasP}
                                            zoom={zoomP}
                                            popup={item.tittle}
                                            height={heightP}
                                        />
                                        <FormContact
                                            asunto={item.tittle}
                                            pref={prefijo}
                                            encabezado={text}
                                        />
                                    </div>
                                )
                            }
                        })}  
                    </Grid>
                    <Grid item xs={6}>
                        <h3>CONTENIDO</h3>
                    </Grid>
                </Grid>      
            </div>
        )
}
